import * as React from 'react';

import Beer from './beer';

interface BeerContainer {
    beers: Array<Beer>
};

export default class BeerList extends React.Component<BeerContainer> {
    state: BeerContainer = {
        beers: [new Beer("corona"),new Beer("86")]
    };

    constructor(container:BeerContainer) {
        super(container);
    }

    render () {
        return (
            <div>
                {this.state.beers.map((b) => (
                    <li>{b}</li>
                ))}
            </div>
    );
    }
}
